import { Pagination } from "react-bootstrap";

export default function PaginationCom() {
  return (
    <div
      style={{
        display: "flex",
        width: "80%",
        margin: "0 auto",
      }}
    >
      <PaginationCom style={{ margin: "0 auto" }}>
        <PaginationCom.First />
        <PaginationCom.Prev />
        <PaginationCom.Item>{1}</PaginationCom.Item>
        <PaginationCom.Ellipsis />

        <PaginationCom.Item>{10}</PaginationCom.Item>
        <PaginationCom.Item>{11}</PaginationCom.Item>
        <PaginationCom.Item active>{12}</PaginationCom.Item>
        <PaginationCom.Item>{13}</PaginationCom.Item>
        <PaginationCom.Item disabled>{14}</PaginationCom.Item>

        <PaginationCom.Ellipsis />
        <PaginationCom.Item>{20}</PaginationCom.Item>
        <PaginationCom.Next />
        <PaginationCom.Last />
      </PaginationCom>
    </div>
  );
}
